import { LOGIN_REQUEST } from '../actions/auth/auth.types'

export const authReducer = (state = {}, action) => {
  console.log(action)
  switch (action.type) {
    case LOGIN_REQUEST:
      state = {
        ...state,
        authenticate: false,
        authenticating: true,
        ...action.payload,
      }

    default:
      return state
  }
}
